import React from 'react';
import styled from 'styled-components'


const H1 = styled.h1`
    background-color: #282c34;
    align-items: center;
    justify-content: center;
    color: white;
`

export default class Dashboard extends React.Component {
    render() {
      return (
          <H1>Dashboard</H1>
      )
    }
}
